from sympy import integer_nthroot, primerange
def aupto(limit):
    aset, maxp = set(), integer_nthroot(limit**2, 3)[0]
    for p in primerange(3, maxp+1):
        pp = p*p
        for q in primerange(1, min(p, limit//pp+1)):
            if (p-1)%q != 0 and (p+1)%q != 0:
                aset.add(pp*q)
    return sorted(aset)
